import { useState } from 'react';

function App() {
  const [url, setUrl] = useState('');

  return (
    <div className="App">
      <h1>Hello, world.</h1>
      <input
        type="text"
        value={url}
        onChange={setUrl}
        placeholder="Enter YouTube video URL"
      />
      <button>yeah</button>
    </div>
  );
}

export default App;
